import React, { Component } from 'react';
import './App.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Container,
    Col,
    Row, } from 'reactstrap';

class App extends Component {
    render() {
        return (
            <Container fluid="true">
                <Navbar color="light" light expand="md">
                  <Col md={{size: 10, offset: 1}} lg={{size:8, offset: 2}}>
                      <NavbarBrand href="/" className="Title">DIY Drone</NavbarBrand>
                  </Col>
                </Navbar>
            </Container>
        );
    }
}

export default App;
